#!/usr/bin/env python3

import unittest

from os import remove
from fourierfit import readdata, vaspdata
from json import load


class TestReadDataSiMedium(unittest.TestCase):

    def setUp(self):
        self.root_folder = 'tests'
        self.extract = vaspdata.VASPData(self.root_folder +
                                         '/test_input/Si_medium')
        self.data = readdata.ReadData(self.root_folder+'/test_input/Si_medium')
        with open(self.root_folder+'/test_input/Si_medium/data.json',
                  mode='r', encoding='utf-8') as inf:
            self.jsondata = load(inf)

    def tearDown(self):
        folder = self.root_folder+'/test_input/Si_medium/'
        files = ['kpts_eigenvals.dat', 'symops_trans.dat', 'kmax.dat',
                 'data.json']
        for f in files:
            remove(folder+f)

